import React, { useState } from "react";
import { ques } from "./api";
import ".accordion/accordion.css";

const Accordion = () => {
    const [ data, setData] = useState(ques);

    return(
        <>
            {data.map((curData) => {
                return curData.ques;
            })}
        </>
    )
}

export default Accordion;
